import React from 'react';
export const RenderLink = ({link}) => {
    console.log(link);
    return (
        <div style={styles.containar}>
            {link.map((el, ind) => (
                <div key={ind}>
                    <a href={el.link}>{el.title}</a>
                </div>
            ))}
        </div>
    )
}

const styles = {
    containar: {
        height: 100,
        backgroundColor: "blue"
    }
}
